import React from 'react';

import Button from 'components/commons/Button/Button';

import styles from './GarageTable.module.scss';
import classNames from 'classnames';

function GarageTable() {

   return(
      <div className = { styles.garageTable }>
         <div className = { styles.tableHead }>
            <Button style = { classNames.headButton } name = "race" />
            <Button style = { classNames.headButton } name = "reset" />
            <Button style = { classNames.headButton } name = "generate car" />
         </div>
      </div>
   )
}

export default GarageTable;
